const DeleteStudent = () => {
  const styles = {
    container: {
      display: "flex",
      flexDirection: "column",
      justifyContent: "center",
      alignItems: "center",
      height: "50vh",
    },
    input: {
      padding: 10,
      borderRadius: 10,
      margin: 10,
      fontSize: 18,
      fontWeight: "600",
      color: "steelblue",
      border: "2px solid grey",
    },
    button: {
      padding: 10,
      backgroundColor: "steelblue",
      width: "10%",
      color: "white",
      fontWeight: "bold",
      fontSize: 18,
      marginTop: 10,
      border: "none",
      borderRadius: 20,
    },
  };
  return (
    <div style={styles.container}>
      <input style={styles.input} placeholder="Enter Student Name" />

      <input style={styles.input} placeholder="Enter Student Class" />

      <button onClick={searchStudent} style={styles.button}>Search</button>
    </div>
  );
};

export default DeleteStudent;
